import './index.css';

const Card = ({ unit }) => {
  return (
    <>
      <div className="card">
        <h1>Card Info</h1>
        <div className="content-card">
          <h2>Nome: {unit.name}</h2>
          <h2>Descrição:</h2>
          <p>{unidade.description}</p>
          <h3>Expansão: {unidade.expansion}</h3>
          <h3>Era: {unidade.age}</h3>
          <h3>Ataque: {unidade.attack}</h3>
          <h3>Armadura: {unidade.armor}</h3>
        </div>
      </div>
    </>
  );
};

export default Card;
